import React from 'react';
import './LoginComponent.css';


const LoginComponent = ((props) => {

  const handleSubmit = (event) => {
    event.preventDefault();
    props.loginState(false);
  }

  return (
    <>
      <form className="login-component">
        <span className="text">Sign In</span>
        <input type="text" placeholder="Login" className="login-form input"></input>
        <input type="password" placeholder="Password" className="login-form input"></input>
        <input type="submit" value="Sign In" className="login-form submit" onClick={handleSubmit}></input>

        <input type="button" value="X" className="login-form close-form" onClick={() => {props.loginState(false)}}></input>
      </form>
    </>
    )
})

export default LoginComponent;
